INSERT INTO `wp_fsmpt_email_logs` VALUES (5,NULL,'a:1:{i:0;a:1:{s:5:\"email\";s:23:\"info@insideoutfocus.com\";}}','Fabre Engineering & UAV Surveying <info@fabreeng.com>','[SITEworx] Your Site is Experiencing a Technical Issue','Howdy!\n\nSince WordPress 5.2 there is a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.\n\nIn this case, WordPress caught an error with one of your plugins, Gravity Forms.\n\nFirst, visit your website (https://wordpress-819206-2895235.cloudwaysapps.com/) and check for any visible issues. Next, visit the page where the error was caught (https://wordpress-819206-2895235.cloudwaysapps.com/wp-admin/) and check for any visible issues.\n\nPlease contact your host for assistance with investigating this issue further.\n\nIf your site appears broken and you can\'t access your dashboard normally, WordPress now has a special \"recovery mode\". This lets you safely login to your dashboard and investigate further.\n\nhttps://wordpress-819206-2895235.cloudwaysapps.com/wp-login.php?action=enter_recovery_mode&rm_token=WrdslBeQjFx0S6UgnA4F9m&rm_key=ohLYf7Jwx1fNPBa3pDlxUQ\n\nTo keep your site safe, this link will expire in 1 day. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.\n\nWhen seeking help with this issue, you may be asked for some of the following information:\nWordPress version 6.1.1\r\nActive theme: Inside Out Creative (version )\r\nCurrent plugin: Gravity Forms (version 2.5.13)\r\nPHP version 7.4.33\n\n\n\nError Details\n=============\nAn error of type E_ERROR was caused in line 2945 of the file /home/819206.cloudwaysapps.com/fgydnqmguq/public_html/wp-content/plugins/gravityforms/common.php. Error message: Uncaught Error: Call to a member function can_be_used() on bool in /home/819206.cloudwaysapps.com/fgydnqmguq/public_html/wp-content/plugins/gravityforms/common.php:2945\nStack trace:\n#0 /home/819206.cloudwaysapps.com/fgydnqmguq/public_html/wp-content/plugins/gravityforms/common.php(3115): GFCommon::get_version_info()\n#1 /home/819206.cloudwaysapps.com/fgydnqmguq/public_html/wp-content/plugins/gravityforms/gravityforms.php(873): GFCommon::check_update()\n#2 /home/819206.cloudwaysapps.com/fgydnqmguq/public_html/wp-includes/class-wp-hook.php(310): GFForms::check_update()\n#3 /home/819206.cloudwaysapps.com/fgydnqmguq/public_html/wp-includes/plugin.php(205): WP_Hook->apply_filters()\n#4 /home/819206.cloudwaysapps.com/fgydnqmguq/public_html/wp-includes/option.php(1986): apply_filters()\n#5 /home/819206.cloudwaysapps.com/fgydnqmguq/public_html/wp-includes/update.php(901): get_site_transient()\n#6 /home/819206.cloudwaysapps.com/fgydnqmguq/public_html/wp-admin/menu.php(33): wp_get_update_data()\n#7 /home/819206.cloudwaysapps.','a:4:{s:8:\"reply-to\";a:0:{}s:2:\"cc\";a:0:{}s:3:\"bcc\";a:0:{}s:12:\"content-type\";s:10:\"text/plain\";}','a:0:{}','failed','a:3:{s:4:\"code\";i:423;s:7:\"message\";s:35:\"SMTP Error: Could not authenticate.\";s:6:\"errors\";a:1:{i:0;s:35:\"SMTP Error: Could not authenticate.\";}}','a:1:{s:8:\"provider\";s:4:\"smtp\";}',0,0,NULL,'2023-03-15 15:01:48',NULL);
