uilt-in GPS receivers, which enhance the efficiency, precision and data collection speed. These features, together with easy integration with other survey equipment and programs, make our total stations the go-to choice for professionals in various industries including construction, mining, land surveying, and more.</span>'),(792,2,'_intro_content_icons_0_content','field_61ddb4b1ae947'),(793,2,'intro_content_icons_0_button','a:3:{s:5:\"title\";s:10:\"Learn More\";s:3:\"url\";s:1:\"#\";s:6:\"target\";s:0:\"\";}'),(794,2,'_intro_content_icons_0_button','field_61d75c44f93e6'),(795,2,'intro_content_icons_1_pretitle','THE LINK BETWEEN VIRTUAL AND REAL WORLD'),(796,2,'_intro_content_icons_1_pretitle','field_61ddb4a3ae945'),(797,2,'intro_content_icons_1_title','THE LINK BETWEEN VIRTUAL AND REAL WORLD'),(798,2,'_intro_content_icons_1_title','field_61ddb4abae946'),(799,2,'intro_content_icons_1_content','<span style=\"font-weight: 400;\">3D SITEworx is the the perfect solution for professionals who demand precision and efficiency in their surveying tasks. Whether you\'re working in construction, mining, land surveying, or any other industry, our state-of-the-art total stations are designed to help you achieve unparalleled survey accuracy. Our easy-to-use interface and advanced software options provide increased flexibility and functionality, making it easy for you to get the job done right. With our technology, you can be confident that you will have the right tool to achieve your project goals with ease.</span>'),(800,2,'_intro_content_icons_1_content','field_61ddb4b1ae947'),(801,2,'intro_content_icons_1_button','a:3:{s:5:\"title\";s:10:\"Learn More\";s:3:\"url\";s:1:\"#\";s:6:\"target\";s:0:\"\";}'),(802,2,'_intro_content_icons_1_button','field_61d75c44f93e6'),(803,2,'intro_content_icons_2_pretitle','PRECISION MEETS VERSATILITY'),(804,2,'_intro_content_icons_2_pretitle','field_61ddb4a3ae945'),(805,2,'intro_content_icons_2_title','PRECISION MEETS VERSATILITY'),(806,2,'_intro_content_icons_2_title','field_61ddb4abae946'),(807,2,'intro_content_icons_2_content','<span style=\"font-weight: 400;\">At 3D SITEworx our</span><span style=\"font-weight: 400;\"> total stations are the ultimate tool for professionals who demand both precision and versatility in their work. Our total stations are designed to deliver the precision you need to get the job done right, while also providing the versatility you need to handle a wide range of surveying applications. Our team and equipment can quickly and easily capture survey data with a high degree of accuracy. </span><span style=\"font-weight: 400;\">With us, you can streamline your survey processes and minimize errors, resulting in more efficient and productive work. Upgrade your process today and experience the precision and versatility of our top-of-the-line expertise.</span>'),(808,2,'_intro_content_icons_2_content','field_61ddb4b1ae947'),(809,2,'intro_content_icons_2_button','a:3:{s:5:\"title\";s:10:\"Learn More\";s:3:\"url\";s:1:\"#\";s:6:\"target\";s:0:\"\";}'),(810,2,'_intro_content_icons_2_button','field_61d75c44f93e6'),(811,122,'custom_css',''),(812,122,'_custom_css','field_605cafca65108'),(813,122,'subtitle','We\'re building a higher standard of excellence each day as we focus on constant improvement in civil engineering and advanced drone surveying services.'),(814,122,'_subtitle','field_61d714b9dd98e'),(815,122,'intro_content_icons','3'),(816,122,'_intro_content_icons','field_61d7514b49fd6'),(817,122,'intro_content_pretitle','UAV / UAS / DRONE MAPPING'),(818,122,'_intro_content_pretitle','field_61d7516749fd7'),(819,122,'intro_content_title','SURVEYING'),(820,122,'_intro_content_title','field_61d7516d49fd8'),(821,122,'intro_content_content','Fabre Engineering &amp; UAV Surveying offers UAV aerial mapping &amp; surveying since 2017 using LiDAR and photogrammetry. Our drones use high-accuracy PPK CPS systems that deliver 0.1\' to 0.2\' vertical accuracy. Lidary is used for sites with trees 