058674'),(7146,291,'slides_1_content','We will provide professional, accurate layout services to our customers so that they can provide a professional and accurate install. Every quality install begins with an accurate layout. Our success is driven by ensuring our customer\'s success.'),(7147,291,'_slides_1_content','field_5fcfba32ee6a2'),(7160,291,'pretitle',''),(7161,291,'_pretitle','field_62f5694fc5601'),(7162,291,'subtext','3DSiteworx is rapidly becoming the Colorado construction industries\' \"go-to\" provider for total station layout. Having pioneered the process of using advanced surveying equipment for fast and accurate construction layouts more than twenty years ago, we have perfected our process while working for various contractors and subcontractors throughout the state.\r\n\r\nNow any company can take advantage of this advanced method of construction layout by partnering with us. We can provide modeling and CAD layouts through our sister company 3DBIMworx or we can use CAD files provided by your own department or from others. Any point that exists in CAD or Revit had X, Y and Z coordinates that we can use quickly and precisely locate sleeves, hangers, walls, embeds or anything else that needs to be located accurately on your jobsite.'),(7163,291,'_subtext','field_62f5694fc5604'),(7164,291,'button',''),(7165,291,'_button','field_62f5694fc5606'),(7166,291,'header_gallery',''),(7167,291,'_header_gallery','field_62f5694fc5609'),(7168,405,'custom_css',''),(7169,405,'_custom_css','field_605cafca65108'),(7170,405,'subtitle',''),(7171,405,'_subtitle','field_61d714b9dd98e'),(7172,405,'content','<span style=\"font-weight: 400;\">Environex is a team of chemical engineers, scientists, and laboratory technicians that has over 140 years of combined experience with emissions control catalyst technologies.Â  Safety and reliability are Environexâ€™s core values.Â  Our safety record and commitment to meeting our customersâ€™ needs reflect these values.Â Â </span>'),(7173