\r\n\r\nBuilt on old-fashioned values with advanced modern technology, Fabre\'s projects include Land development, roadway improvements, water &amp; sewer improvements, drainage studies, grading &amp; erosion control plans, schools, and parks. Specialty experience in building existing and proposed 3D topo surfaces.'),(12141,585,'_about_content_content','field_61d75418ddba4'),(12142,585,'about_content','2'),(12143,585,'_about_content','field_61d753e5ddba2'),(12144,585,'intro_content_icons_0_icon','456'),(12145,585,'_intro_content_icons_0_icon','field_61d75c39f93e5'),(12146,585,'intro_content_icons_0_link','a:3:{s:5:\"title\";s:13:\"UAV SURVEYING\";s:3:\"url\";s:1:\"#\";s:6:\"target\";s:0:\"\";}'),(12147,585,'_intro_content_icons_0_link','field_61d75c44f93e6'),(12148,585,'intro_content_icons_1_icon','457'),(12149,585,'_intro_content_icons_1_icon','field_61d75c39f93e5'),(12150,585,'intro_content_icons_1_link','a:3:{s:5:\"title\";s:17:\"CIVIL ENGINEERING\";s:3:\"url\";s:1:\"#\";s:6:\"target\";s:0:\"\";}'),(12151,585,'_intro_content_icons_1_link','field_61d75c44f93e6'),(12152,585,'intro_content_icons_2_icon','458'),(12153,585,'_intro_content_icons_2_icon','field_61d75c39f93e5'),(12154,585,'intro_content_icons_2_link','a:3:{s:5:\"title\";s:14:\"WHY CHOOSE US?\";s:3:\"url\";s:1:\"#\";s:6:\"target\";s:0:\"\";}'),(12155,585,'_intro_content_icons_2_link','field_61d75c44f93e6'),(12156,585,'about_content_background_image','100'),(12157,585,'_about_content_background_image','field_61d76a832bacc'),(12158,585,'header','a:3:{i:0;s:2:\"46\";i:1;s:3:\"100\";i:2;s:2:\"91\";}'),(12159,585,'_header','field_61d88ab15b66e'),(12160,585,'header_gallery',''),(12161,585,'_header_gallery','field_61d88ab15b66e'),(12162,585,'intro_content_icons_0_pretitle',''),(12163,585,'_intro_content_icons_0_pretitle','field_61ddb4a3ae945'),(12164,585,'intro_content_icons_0_title','3D INDUSTRIAL SITE MANAGEMENT'),(12165,585,'_intro_content_icons_0_title','field_61ddb4abae946'),(12166,585,'intro_content_icons_0_content','<span style=\"font-weight: 400;\">Our total station technology is revolutionizing the field of surveying. These advanced instruments combine precision measurements with versatile functionality, making them essential for a wide range of surveying applications. They use a combination of a theodolite, electronic distance measurement (EDM) device, and a microprocessor to accurately measure angles and distances to survey points. Our tools incorporate advanced features such as long-range EDM capabilities, and built-in GPS receivers, which enhance the efficiency, precision and data collection speed. These features, together with easy integration with other survey equipment and programs, make our total stations the go-to choice for professionals in various industries including construction, mining, land surveying, and more.</span>'),(12167,585,'_intro_content_icons_0_content','field_61ddb4b1ae947'),(12168,585,'intro_content_icons_0_button','a:3:{s:5:\"title\";s:10:\"Learn More\";s:3:\"url\";s:1:\"#\";s:6:\"target\";s:0:\"\";}'),(12169,585,'_intro_content_icons_0_button','field_61d75c44f93e6'),(12170,585,'intro_content_icons_1_pretitle','THE LINK BETWEEN VIRTUAL AND REAL WORLD'),(12171,585,'_intro_content_icons_1_pretitle','field_61ddb4a3ae945'),(12172,585,'intro_content_icons_1_title','THE LINK BETWEEN VIRTUAL AND REAL WORLD'),(12173,585,'_intro_content_icons_1_title','field_61ddb4abae946'),(12174,585,'intro_content_icons_1_content','<span style=\"font-weight: 400;\">3D SITEworx is the the perfect solution for professionals who demand precision and efficiency in their surveying tasks. Whether you\'re working in construction, mining, land surveying, or any other industry, our state-of-the-art total stations are designed to help you achieve unparalleled survey accuracy. Our easy-to-use interface and advanced software options provide increased flexibility and functionality, making it easy for you to get the job done right. With our technology, you can be confident that you will have the right tool to achieve your project goals with ease.</span>'),(12175,585,'_intro_content_icons_1_content','field_61ddb4b1ae947'),(12176,585,'intro_content_icons_1_button','a:3:{s:5:\"title\";s:10:\"Learn More\";s:3:\"url\";s:1:\"#\";s:6:\"target\";s:0:\"\";}'),(12177,585,'_intro_content_icons_1_button','field_61d75c44f93e6'),(12178,585,'intro_content_icons_2_pretitle','PRECISION MEETS VERSATILITY'),(12179,585,'_intro_content_icons_2_pretitle','field_61ddb4a3ae945'),(12180,585,'intro_content_icons_2_title','PRECISION MEETS VERSATILITY'),(12181,585,'_intro_content_icons_2_title','field_61ddb4abae946'),(12182,585,'intro_content_icons_2_content','<span style=\"font-weight: 400;\">At 3D SITEworx our</span><span style=\"font-weight: 400;\"> total stations are the ultimate tool for professionals who demand both precision and versatility in their work. Our total stations are designed to deliver the precision you need to get the job done right, while also providing the versatility you need to handle a wide range of surveying applications. Our team and equipment can quickly and easily capture survey data with a high degree of accuracy. </span><span style=\"font-weight: 400;\">With us, you can streamline your survey processes and minimize errors, resulting in more efficient and productive work. Upgrade your process today and experience the precision and versatility of our top-of-the-line expertise.</span>'),(12183,585,'_intro_content_icons_2_content','field_61ddb4b1ae947'),(12184,585,'intro_content_icons_2_button','a:3:{s:5:\"title\";s:10:\"Learn More\";s:3:\"url\";s:1:\"#\";s:6:\"target\";s:0:\"\";}'),(12185,585,'_intro_content_icons_2_button','field_61d75c44f93e6'),(12186,585,'intro_content_icons_0_buttons',''),(12187,585,'_intro_content_icons_0_buttons','field_61d75c44f93e6'),(12188,585,'intro_content_icons_1_buttons',''),(12189,585,'_intro_content_icons_1_buttons','field_61d75c44f93e6'),(12190,585,'intro_content_icons_2_buttons',''),(12191,585,'_intro