6\";i:1;s:3:\"100\";i:2;s:2:\"91\";}'),(12391,587,'_header','field_61d88ab15b66e'),(12392,587,'header_gallery',''),(12393,587,'_header_gallery','field_61d88ab15b66e'),(12394,587,'intro_content_icons_0_pretitle',''),(12395,587,'_intro_content_icons_0_pretitle','field_61ddb4a3ae945'),(12396,587,'intro_content_icons_0_title','3D INDUSTRIAL SITE MANAGEMENT'),(12397,587,'_intro_content_icons_0_title','field_61ddb4abae946'),(12398,587,'intro_content_icons_0_content','<span style=\"font-weight: 400;\">Our total station technology is revolutionizing the field of surveying. These advanced instruments combine precision measurements with versatile functionality, making them essential for a wide range of surveying applications. They use a combination of a theodolite, electronic distance measurement (EDM) device, and a microprocessor to accurately measure angles and distances to survey points. Our tools incorporate advanced features such as long-range EDM capabilities, and built-in GPS receivers, which enhance the efficiency, precision and data collection speed. These features, together with easy integration with other survey equipment and programs, make our total stations the go-to choice for professionals in various industries including construction, mining, land surveying, and more.</span>'),(12399,587,'_intro_content_icons_0_content','field_61ddb4b1ae947'),(12400,587,'intro_content_icons_0_button','a:3:{s:5:\"title\";s:10:\"Learn More\";s:3:\"url\";s:1:\"#\";s:6:\"target\";s:0:\"\";}'),(12401,587,'_intro_content_icons_0_button','field_61d75c44f93e6'),(12402,587,'intro_content_icons_1_pretitle','THE LINK BETWEEN VIRTUAL AND REAL WORLD'),(12403,587,'_intro_content_icons_1_pretitle','field_61ddb4a3ae945'),(12404,587,'intro_content_icons_1_title','THE LINK BETWEEN VIRTUAL AND REAL WORLD'),(12405,587,'_intro_content_icons_1_title','field_61ddb4abae946'),(12406,587,'intro_content_icons_1_content','<span style=\"font-weight: 400;\">3D SITEworx is the the perfect solution for professionals who demand precision and efficiency in their surveying tasks. Whether you\'re working in construction, mining, land surveying, or any other industry, our state-of-the-art total stations are designed to help you achieve unparalleled survey accuracy. Our easy-to-use interface and advanced software options provide increased flexibility and functionality, making it easy for you to get the job done right. With our technology, you can be confident that you will have the right tool to achieve your project goals with ease.</span>'),(12407,587,'_intro_content_icons_1_content','field_61ddb4b1ae947'),(12408,587,'intro_content_icons_1_button','a:3:{s:5:\"title\";s:10:\"Learn More\";s:3:\"url\";s:1:\"#\";s:6:\"target\";s:0:\"\";}'),(12409,587,'_intro_content_icons_1_button','field_61d75c44f93e6'),(12410,587,'intro_content_icons_2_pretitle','PRECISION MEETS VERSATILITY'),(12411,587,'_intro_content_icons_2_pretitle','field_61ddb4a3ae945'),(12412,587,'intro_content_icons_2_title','PRECISION MEETS VERSATILITY'),(12413,587,'_intro_content_icons_2_title','field_61ddb4abae946'),(12414,587,'intro_content_icons_2_content','<span style=\"font-weight: 400;\">At 3D SITEworx our</span><span style=\"font-weight: 400;\"> total stations are the ultimate tool for professionals who demand both precision and versatility in their work. Our total stations are designed to deliver the precision you need to get the job done right, while also providing the versatility you need to handle a wide range of surveying applications. Our team and equipment can quickly and easily capture survey data with a high degree of accuracy. </span><span style=\"font-weight: 400;\">With us, you can streamline your survey processes and minimize errors, resulting in more efficient and productive work. Upgrade your process today and experience the precision and versatility of our top-of-the-line expertise.</span>'),(12415,587,'_intro_content_icons_2_content','field_61ddb4b1ae947'),(12416,587,'intro_content_icons_2_but