'intro_content_icons_2_icon','458'),(12617,588,'_intro_content_icons_2_icon','field_61d75c39f93e5'),(12618,588,'intro_content_icons_2_link','a:3:{s:5:\"title\";s:14:\"WHY CHOOSE US?\";s:3:\"url\";s:1:\"#\";s:6:\"target\";s:0:\"\";}'),(12619,588,'_intro_content_icons_2_link','field_61d75c44f93e6'),(12620,588,'about_content_background_image','100'),(12621,588,'_about_content_background_image','field_61d76a832bacc'),(12622,588,'header','a:3:{i:0;s:2:\"46\";i:1;s:3:\"100\";i:2;s:2:\"91\";}'),(12623,588,'_header','field_61d88ab15b66e'),(12624,588,'header_gallery',''),(12625,588,'_header_gallery','field_61d88ab15b66e'),(12626,588,'intro_content_icons_0_pretitle',''),(12627,588,'_intro_content_icons_0_pretitle','field_61ddb4a3ae945'),(12628,588,'intro_content_icons_0_title','3D INDUSTRIAL SITE MANAGEMENT'),(12629,588,'_intro_content_icons_0_title','field_61ddb4abae946'),(12630,588,'intro_content_icons_0_content','<span style=\"font-weight: 400;\">Our total station technology is revolutionizing the field of surveying. These advanced instruments combine precision measurements with versatile functionality, making them essential for a wide range of surveying applications. They use a combination of a theodolite, electronic distance measurement (EDM) device, and a microprocessor to accurately measure angles and distances to survey points. Our tools incorporate advanced features such as long-range EDM capabilities, and built-in GPS receivers, which enhance the efficiency, precision and data collection speed. These features, together with easy integration with other survey equipment and programs, make our total stations the go-to choice for professionals in various industries including construction, mining, land surveying, and more.</span>'),(12631,588,'_intro_content_icons_0_content','field_61ddb4b1ae947'),(12632,588,'intro_content_icons_0_button','a:3:{s:5:\"title\";s:10:\"Learn More\";s:3:\"url\";s:1:\"#\";s:6:\"target\";s:0:\"\";}'),(12633,588,'_intro_content_icons_0_button','field_61d75c44f93e6'),(12634,588,'intro_content_icons_1_pretitle','THE LINK BETWEEN VIRTUAL AND REAL WORLD'),(12635,588,'_intro_content_icons_1_pretitle','field_61ddb4a3ae945'),(12636,588,'intro_content_icons_1_title','THE LINK BETWEEN VIRTUAL AND REAL WORLD'),(12637,588,'_intro_content_icons_1_title','field_61ddb4abae946'),(12638,588,'intro_content_icons_1_content','<span style=\"font-weight: 400;\">3D SITEworx is the the perfect solution for professionals who demand precision and efficiency in their surveying tasks. Whether you\'re working in construction, mining, land surveying, or any other industry, our state-of-the-art total stations are designed to help you achieve unparalleled survey accuracy. Our easy-to-use interface and advanced software options provide increased flexibility and functionality, making it easy for you to get the job done right. With our technology, you can be confident that you will have the right tool to achieve your project goals with ease.</span>'),(12639,588,'_intro_content_icons_1_content','field_61ddb4b1ae947'),(12640,588,'intro_content_icons_1_button','a:3:{s:5:\"title\";s:10:\"Learn More\";s:3:\"url\";s:1:\"#\";s:6:\"target\";s:0:\"\";}'),(12641,588,'_intro_content_icons_1_button','field_61d75c44f93e6'),(12642,588,'intro_content_icons_2_pretitle','PRECISION MEETS VERSATILITY'),(12643,588,'_intro_content_icons_2_pretitle','field_61ddb4a3ae945'),(12644,588,'intro_content_icons_2_title','PRECISION MEETS VERSATILITY'),(12645,588,'_intro_content_icons_2_title','field_61ddb4abae946'),(12646,588,'intro_content_icons_2_content','<span style=\"font-weight: 400;\">At 3D SITEworx our</span><span style=\"font-weight: 400;\"> total stations are the ultimate tool for professionals who demand both precision and versatility in their work. Our total stations are designed to deliver the precision you need to get the job done right, while also providing the versatility you need to handle a wide range of surveying applications. Our team and equipment can quickly and easily capture survey data with a high degree of accuracy. </span><span style=\"font-weight: 400;\">With us, you can streamline your survey processes and minimize errors, resulting in more efficient and productive work. Upgrade your process today and experience the precision and versatility of our top-of-the-line expertise.</span>'),(12647,588,'_intro_content_icons_2_content','field_61ddb4b1ae947'),(12648,588,'intro_content_icons_2_button','a:3:{s:5:\"title\";s:10:\"Learn More\";s:3:\"url\";s:1:\"#\";s:6:\"target\";s:0:\"\";}'),(12649,588,'_intro_content_icons_2_button','field_61d75c44f93e6'),(12650,588,'intro_content_icons_0_buttons',''),(12651,588,'_intro_content_icons_0_buttons','field_61d75c44f93e6'),(12652,588,'intro_content_icons_1_buttons',''),(12653,588,'_intro_content_icons_1_buttons','field_61d75c44f93e6'),(12654,588,'intro_content_icons_2_buttons',''),(12655,588,'_intro_content_icons_2_buttons','field_61d75c44f93e6'),(12656,588,'about_content_0_image','241'),(12657,588,'_about_content_0_image','field_620ab08175854'),(12658,588,'about_content_0_link','a:3:{s:5:\"title\";s:10:\"WHO WE ARE\";s:3:\"url\";s:7:\"/about/\";s:6:\"target\";s:0:\"\";}'),(12659,588,'_about_content_0_link','field_620ab06e75853'),(12660,588,'about_content_1_image','242'),(12661,588,'_about_content_1_image','field_620ab08175854'),(12662,588,'about_content_1_link','a:3:{s:5:\"title\";s:13:\"WHY CHOOSE US\";s:3:\"url\";s:21:\"/about/#why-choose-us\";s:6:\"target\";s:0:\"\";}'),(12663,588,'_about_content_1_link','field_620ab06e75853'),(12664,588,'news_title','INSIGHTS'),(12665,588,'_news_title','field_620a9bf8eaba6'),(12666,588,'news_content',''),(12667,588,'_news_content','field_620a9c01eaba7'),(12668,588,'news_posts','a:3:{i:0;s:3:\"243\";i:1;s:3:\"245\";i:2;s:3:\"247\";}'),(12669,588,'_news_posts','field_620a9c0aeaba8'),(12670,588,'news',''),(12671,588,'_news','field_620a9be2eaba5'),(12672,588,'about_area_background_image',''),(12673,588,'_about_area_background_image','f