a-bold\">RECENT PROJECTS</h2>'),(12843,591,'_past_projects_content','field_61d753bdddb9f'),(12844,591,'past_projects_gallery','a:6:{i:0;s:3:\"496\";i:1;s:3:\"497\";i:2;s:3:\"498\";i:3;s:3:\"499\";i:4;s:3:\"500\";i:5;s:3:\"501\";}'),(12845,591,'_past_projects_gallery','field_61d753c9ddba0'),(12846,591,'past_projects',''),(12847,591,'_past_projects','field_61d7538fddb9d'),(12848,591,'about_content_title','ABOUT US'),(12849,591,'_about_content_title','field_61d75414ddba3'),(12850,591,'about_content_content','With over 35 years of experience in delivering on our promises, Fabre Engineering &amp; UAV Surveying has a strong focus on civil engineering and surveying professions.\r\n\r\nBuilt on old-fashioned values with advanced modern technology, Fabre\'s projects include Land development, roadway improvements, water &amp; sewer improvements, drainage studies, grading &amp; erosion control plans, schools, and parks. Specialty experience in building existing and proposed 3D topo surfaces.'),(12851,591,'_about_content_content','field_61d75418ddba4'),(12852,591,'about_content','2'),(12853,591,'_about_content','field_61d753e5ddba2'),(12854,591,'intro_content_icons_0_icon','456'),(12855,591,'_intro_content_icons_0_icon','field_61d75c39f93e5'),(12856,591,'intro_content_icons_0_link','a:3:{s:5:\"title\";s:13:\"UAV SURVEYING\";s:3:\"url\";s:1:\"#\";s:6:\"target\";s:0:\"\";}'),(12857,591,'_intro_content_icons_0_link','field_61d75c44f93e6'),(12858,591,'intro_content_icons_1_icon','457'),(12859,591,'_intro_content_icons_1_icon','field_61d75c39f93e5'),(12860,591,'intro_content_icons_1_link','a:3:{s:5:\"title\";s:17:\"CIVIL ENGINEERING\";s:3:\"url\";s:1:\"#\";s:6:\"target\";s:0:\"\";}'),(12861,591,'_intro_content_icons_1_link','field_61d75c44f93e6'),(12862,591,'intro_content_icons_2_icon','458'),(12863,591,'_intro_content_icons_2_icon','field_61d75c39f93e5'),(12864,591,'intro_content_icons_2_link','a:3:{s:5:\"title\";s:14:\"WHY CHOOSE US?\";s:3:\"url\";s:1:\"#\";s:6:\"target\";s:0:\"\"