ETWEEN VIRTUAL AND REAL WORLD'),(12883,591,'_intro_content_icons_1_title','field_61ddb4abae946'),(12884,591,'intro_content_icons_1_content','<span style=\"font-weight: 400;\">3D SITEworx is the the perfect solution for professionals who demand precision and efficiency in their surveying tasks. Whether you\'re working in construction, mining, land surveying, or any other industry, our state-of-the-art total stations are designed to help you achieve unparalleled survey accuracy. Our easy-to-use interface and advanced software options provide increased flexibility and functionality, making it easy for you to get the job done right. With our technology, you can be confident that you will have the right tool to achieve your project goals with ease.</span>'),(12885,591,'_intro_content_icons_1_content','field_61ddb4b1ae947'),(12886,591,'intro_content_icons_1_button','a:3:{s:5:\"title\";s:10:\"Learn More\";s:3:\"url\";s:1:\"#\";s:6:\"target\";s:0:\"\";}'),(12887,591,'_intro_content_icons_1_button','field_61d75c44f93e6'),(12888,591,'intro_content_icons_2_pretitle','PRECISION MEETS VERSATILITY'),(12889,591,'_intro_content_icons_2_pretitle','field_61ddb4a3ae945'),(12890,591,'intro_content_icons_2_title','PRECISION MEETS VERSATILITY'),(12891,591,'_intro_content_icons_2_title','field_61ddb4abae946'),(12892,591,'intro_content_icons_2_content','<span style=\"font-weight: 400;\">At 3D SITEworx our</span><span style=\"font-weight: 400;\"> total stations are the ultimate tool for professionals who demand both precision and versatility in their work. Our total stations are designed to deliver the precision you need to get the job done right, while also providing the versatility you need to handle a wide range of surveying applications. Our team and equipment can quickly and easily capture survey data with a high degree of accuracy. </span><span style=\"font-weight: 400;\">With us, you can streamline your survey processes and minimize errors, resulting in more efficient and productive work. Upgrade your process today and experience the precision and versatility of our top-of-the-line expertise.</span>'),(12893,591,'_intro_content_icons_2_content','field_61ddb4b1ae947'),(12894,591,'intro_content_icons_2_button','a:3:{s:5:\"title\";s:10:\"Learn More\";s:3:\"url\";s:1:\"#\";s:6:\"target\";s:0:\"\";}'),(12895,591,'_intro_content_icons_2_button','field_61d75c44f93e6'),(12896,591,'intro_content_icons_0_buttons',''),(12897,591,'_intro_content_icons_0_buttons','field_61d75c44f93e6'),(12898,591,'intro_content_icons_1_buttons',''),(12899,591,'_intro_content_icons_1_buttons','field_61d75c44f93e6'),(12900,591,'intro_content_icons_2_buttons',''),(12901,591,'_intro_content_icons_2_buttons','field_61d75c44f93e6'),(12902,591,'about_content_0_image','241'),(12903,591,'_about_content_0_image','field_620ab08175854'),(12904,591,'about_content_0_link','a:3:{s:5:\"title\";s:10:\"WHO WE ARE\";s:3:\"url\";s:7:\"/about/\";s:6:\"target\";s:0:\"\";}'),(12905,591,'_about_content_0_link','field_620ab06e75853'),(12906,591,'about_content_1_image','242'),(12907,591,'_about_content_1_image','field_620ab08175854'),(12908,591,'about_content_1_link','a:3:{s:5:\"title\";s:13:\"WHY CHOOSE US\";s:3:\"url\";s:21:\"/about/#why-choose-us\";s:6:\"target\";s:0:\"\";}'),(12909,591,'_about_content_1_link','field_620ab06e75853'),(12910,591,'news_title','INSIGHTS'),(12911,591,'_news_title','field_620a9bf8eaba6'),(12912,591,'news_content',''),(12913,591,'_news_content','field_620a9c01eaba7'),(12914,591,'news_posts','a:3:{i:0;s:3:\"243\";i:1;s:3:\"245\";i:2;s:3:\"247\";}'),(12915,591,'_news_posts','field_620a9c0aeaba8'),(12916,591,'news',''),(12917,591,'_news','field_620a9be2eaba5'),(12918,591,'about_area_background_image',''),(12919,591,'_about_area_background_image','field_620ad3480b03f'),(12920,591,'about_area_about_0_image',''),(12921,591,'_about_area_about_0_image','field_620ad35c0b041'),(12922,591,'about_area_about_0_link','a:3:{s:5:\"title\";s:10:\"WHO WE ARE\";s:3:\"url\";s:12:\"/who-we-