INSERT INTO `wp_posts` VALUES (2,1,'2022-01-05 19:34:14','2022-01-05 19:34:14','','THE PREMIER<br>PROVIDER OF<br>TOTAL STATION<br>LAYOUT IN<br>COLORADO','','publish','closed','closed','','sample-page','','','2023-03-28 15:54:37','2023-03-28 15:54:37','',0,'https://wordpress-819206-2895235.cloudwaysapps.com/?page_id=2',0,'page','',0),(4,1,'2022-01-05 00:00:00','2022-01-05 00:00:00','<p>It seems like youâ€™re running a default WordPress website. Here are a few useful links to get you started:</p>\n			<h3>Migration</h3>\n			<ul>\n				<li><a href=\"https://support.cloudways.com/how-to-migrate-wordpress-to-cloudways/?utm_source=WordPress&amp;Staging&amp;Sites&amp;utm_medium=WP&amp;Staging&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noopener, noindex, nofollow noopener\">How to use WordPress Migrator Plugin?</a></li>\n				<li><a href=\"https://support.cloudways.com/siteground-to-cloudways-wordpress-migration/?utm_source=WordPress&amp;&amp;Sites&amp;utm_medium=WP&amp;&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noopener, noindex, nofollow noopener\">Migrate WordPress from Siteground to Cloudways</a></li>\n				<li><a href=\"https://support.cloudways.com/godaddy-to-cloudways-wordpress-migration/?utm_source=WordPress&amp;&amp;Sites&amp;utm_medium=WP&amp;&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noopener, noindex, nofollow noopener\">Migrate WordPress from GoDaddy to Cloudways</a></li>\n				</ul>\n				<h3>General</h3>\n				<ul>\n					<li><a href=\"https://support.cloudways.com/how-do-i-take-my-website-live-from-cloudways/?utm_source=WordPress&amp;&amp;Sites&amp;utm_medium=WP&amp;&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noopener, noindex, nofollow noopener\">How do I take my website live from Cloudways?</a></li>\n					<li><a href=\"https://support.cloudways.com/how-to-manage-wordpress-with-wp-cli/?utm_source=WordPress&amp;&amp;Sites&amp;utm_medium=WP&amp;&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noopener, noindex, nofollow noopener\">How to manage WordPress via WP-CLI on Cloudways?</a></li>\n					<li><a href=\"https://support.cloudways.com/how-to-setup-a-wordpress-multisite-on-cloudways/?utm_source=WordPress&amp;&amp;Sites&amp;utm_medium=WP&amp;&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noopener, noindex, nofollow noopener\">How to configure WordPress Multisite on Cloudways?</a></li>\n					<li><a href=\"https://support.cloudways.com/mysql-database-access-options/?utm_source=WordPress&amp;&amp;Sites&amp;utm_medium=WP&amp;&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noopener, noindex, nofollow noopener\">How to access your databases on Cloudways?</a></li>\n					</ul>\n					<h3>Performance</h3>\n					<ul>\n						<li><a href=\"https://support.cloudways.com/breeze-wordpress-cache-configuration/?utm_source=WordPress&amp;&amp;Sites&amp;utm_medium=WP&amp;&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noopener, noindex, nofollow noopener\">How to install and configure Breeze WordPress cache plugin?</a></li>\n						<li><a href=\"https://support.cloudways.com/wordpress-cloudways-cdn/?utm_source=WordPress&amp;&amp;Sites&amp;utm_medium=WP&amp;&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noopener, noindex, nofollow noopener\">How to integrate CloudwaysCDN with your WordPress website?</a></li>\n						<li><a href=\"https://support.cloudways.com/how-to-configure-wp-rocket-plugin-wordpress/?utm_source=WordPress&amp;&amp;Sites&amp;utm_medium=WP&amp;&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noopener, noindex, nofollow noopener\">How to configure WP Rocket plugin for WordPress?</a></li>\n						</ul>\n						<h3>Security</h3>\n						<ul>\n							<li><a href=\"https://support.cloudways.com/what-can-i-do-with-an-htaccess-file/?utm_source=WordPress&amp;&amp;Sites&amp;utm_medium=WP&amp;&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noopener, noindex, nofollow noopener\" data-wplink-edit=\"true\">What can I do with an .htaccess file?</a></li>\n							<li><a href=\"https://www.cloudways.com/blog/add-free-ssl-certificate-to-wordpress-websites/?utm_source=WordPress&amp;&amp;Sites&amp;utm_medium=WP&amp;&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noopener, noindex, nofollow noopener\">Add free SSL certificate to WordPress websites</a></li>\n							<li><a href=\"https://support.cloudways.com/how-to-set-up-sucuri-antivirus-website-monitoring/?utm_source=WordPress&amp;&amp;Sites&amp;utm_medium=WP&amp;&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noopener, noindex, nofollow noopener\">How to setup Sucuri on WordPress websites at Cloudways?</a></li>\n							</ul>\n							<h3>Email</h3>\n							<ul>\n								<li><a href=\"https://support.cloudways.com/emailing-with-cloudways/?utm_source=WordPress&amp;&amp;Sites&amp;utm_medium=WP&amp;&amp;utm_campaign=cloudways-wp&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noopener, noindex, nofollow noopener\">Which email add-on should I use?</a></li>\n								<li><a href=\"https://support.cloudways.com/how-to-activate-rackspace-email-addon/?utm_source=WordPress&amp;&amp;Sites&amp;utm_medium=WP&amp;&amp;utm_campaign=cloudways-wp&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noopener, noindex, nofollow noopener\">How to activate Rackspace email addon?</a></li>\n								<li><a href=\"https://support.cloudways.com/how-to-activate-elasticemail-addon/?utm_source=WordPress&amp;&amp;Sites&amp;utm_medium=WP&amp;&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noopener, noindex, nofollow noopener\">How to activate the Elastic email add-on?</a></li>\n								</ul>\n\n								<!-- wp:heading {\"level\":4} -->\n								<h4>Our Partners</h4>\n								<!-- /wp:heading -->\n\n								<!-- wp:image {\"id\":15,\"linkDestination\":\"custom\"} -->\n								<figure class=\"wp-block-image\"><a href=\"https://mainwp.com/?utm_source=cloudways-partner&amp;utm_campaign=cloudways\" target=\"_blank\" rel=\"noreferrer, noopener, noindex, nofollow noopener\"><img src=\"https://s3.amazonaws.com/cloudways-static-content/applications/wordpress/mainWP-Banner-1.jpg\" alt=\"\" class=\"wp-image-15\"/></a></figure>\n								<!-- /wp:image -->\n\n								<!-- wp:image {\"id\":20,\"linkDestination\":\"custom\"} -->\n								<figure class=\"wp-block-image\"><a href=\"https://oceanwp.org/?utm_source=cloudways-partner&amp;utm_campaign=cloudways\" target=\"_blank\" rel=\"noreferrer, noopener, noindex, nofollow noopener\"><img src=\"https://s3.amazonaws.com/cloudways-static-content/applications/wordpress/OceanWP-Banner.jpg\" alt=\"\" class=\"wp-image-20\"/></a></figure>\n								<!-- /wp:image -->\n\n								<!-- wp:heading {\"level\":4} -->\n								<h4>Join The Community Forum<br></h4>\n									<!-- /wp:heading -->\n\n									<!-- wp:image {\"id\":23,\"linkDestination\":\"custom\"} -->\n									<figure class=\"wp-block-image\"><a href=\"https://community.cloudways.com/?utm_source=cloudways-wp&amp;utm_medium=cloudways&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noreferrer, noopener, noindex, nofollow noopener\"><img src=\"https://s3.amazonaws.com/cloudways-static-content/applications/wordpress/cloudways-community1.jpg\" alt=\"\" class=\"wp-image-23\"/></a></figure>\n									<!-- /wp:image -->\n\n</ul>','Some Useful Links for You to Get Started','','publish','open','open','','welcome-to-cloudways','','','2022-01-05 00:00:00','2022-01-05 00:00:00','',0,'https://wordpress-819206-2895235.cloudwaysapps.com/?p=1',0,'post','',1),(12,1,'2022-01-05 21:42:28','2022-01-05 21:42:28','a:8:{s:8:\"location\";a:2:{i:0;a:1:{i:0;a:3:{s:5:\"param\";s:9:\"post_type\";s:8:\"operator\";s:2:\"==\";s:5:\"value\";s:4:\"post\";}}i:1;a:1:{i:0;a:3:{s:5:\"param\";s:9:\"post_type\";s:8:\"operator\";s:2:\"==\";s:5:\"value\";s:4:\"page\";}}}s:8:\"position\";s:6:\"normal\";s:5:\"style\";s:7:\"default\";s:15:\"label_placement\";s:3:\"top\";s:21:\"instruction_placement\";s:5:\"label\";s:14:\"hide_on_screen\";s:0:\"\";s:11:\"descrip